static inline
unsigned _s1_a(unsigned a )
{
	unsigned r = 0;
	while(a){
		r ^= _s1_tab[__builtin_ffs(a)-1];
		a &= (a-1);
	}
	return r;
}

static inline
unsigned calc_s_k_a( unsigned k , unsigned a )
{
#ifdef _EXIT_WHILE_SKA_OUT_OF_RANGE_
	printf("k(%d) a(0x%x) out of range.\n",k,a);
	exit(-1);
#endif
	unsigned r = a << (k+1);
	while( k ) {
		r = _s1_a(r);
		k--;
	}
	return r;
}



